For the purposes of this example, we'll create a module that wraps the MemInfo struct, and expose the information there. Since we'll be implementing traits that are defined inside the steel crate, we'll need to create a struct to wrap the sys_info::MemInfo struct: struct MemoryInfo { info: sys_info::MemInfo,
} impl MemoryInfo { fn total(&self) -> isize { self.info.total as isize } fn avail(&self) -> isize { self.info.avail as isize } fn free(&self) -> isize { self.info.free as isize } fn buffers(&self) -> isize { self.info.buffers as isize } fn cached(&self) -> isize { self.info.cached as isize } fn swap_total(&self) -> isize { self.info.swap_total as isize } fn swap_free(&self) -> isize { self.info.swap_free as isize }
} Now that we've done that, we can expose this to steel by implementing the Custom type for the struct, and declaring an FFIModule: // Using ABI Stable types is very important
use steel::{ declare_module, rvals::Custom, steel_vm::ffi::{FFIModule, RegisterFFIFn},
}; impl Custom for MemoryInfo {} declare_module!(create_module); fn create_module() -> FFIModule { let mut module = FFIModule::new("steel/sys-info"); module.register_fn("mem-info", || MemoryInfo { info: sys_info::mem_info().unwrap(), }); module .register_fn("MemoryInfo-total", MemoryInfo::total) .register_fn("MemoryInfo-avail", MemoryInfo::avail) .register_fn("MemoryInfo-free", MemoryInfo::free) .register_fn("MemoryInfo-buffers", MemoryInfo::buffers) .register_fn("MemoryInfo-cached", MemoryInfo::cached) .register_fn("MemoryInfo-swap-total", MemoryInfo::swap_total) .register_fn("MemoryInfo-swap-free", MemoryInfo::swap_free); module
} The register_fn API will perform all of the necessary coercions necessary to make this as safe as possible. At the end of the day, this is FFI and we are loading shared libraries, so there is some unsafe Rust code, however steel uses the underlying abi_stable library in order to make interactions with the shared library as safe as possible.

